import React from "react";
import styled from "styled-components";
import { Link } from "react-router-dom";
import { tablet } from "../Responsive";

const Wrapper = styled.main`
  margin: 0;
  padding: 0;
  width: 100%;
  background: rgb(198, 208, 206);

  .login {
    background: #528;
    color: white;
    margin: 10px;
    margin-left: 0;
  }
  .hero {
    width: 100%;
    text-align: center;
    margin-top: 20px;
  }
  .page {
    /* background: #dce4e2; */
    margin: 0;
    padding: 10px;
    min-height: calc(100vh - 60px);
    width: 100vw;
    ${tablet({ display: "flex" })}
  }

  div {
    width: 100%;
  }
  img {
    height: 80%;
    object-fit: contain;
    width: 90%;
  }
  nav {
    width: 100%;
    display: flex;
    align-items: center;
    color: #673480;
    height: 60px;
  }

  nav img {
    border-radius: 10px;
    margin: 0 20px;
  }
  h1 {
    color: #528;
  }
`;

const Landing = () => {
  return (
    <Wrapper>
      <div className="container">
        <nav className="text-info">
          <img src="/images/logo.png" alt="brand" height="30" width="30" />
          <h1>World jobs</h1>
        </nav>
        <div className="page">
          <div className="info mx-3">
            <h2>Job Tracking App</h2>
            <p className="">
              Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do
              eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut
              enim ad minim veniam, quis nostrud exercitation ullamco laboris-
              nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in
              reprehenderit in voluptate velit esse cillum dolore eu fugiat
              nulla pariatur. Excepteur sint occaecat cupidatat non proident,
              sunt in culpa qui officia deserunt mollit anim id est laborum.
            </p>
            <Link to="/login" className="btn login">
              Login/Register
            </Link>
          </div>
          <div className="hero">
            <img src="/images/main.jpg" alt="job hunt" className="main-img" />
          </div>
        </div>
      </div>
    </Wrapper>
  );
};

export default Landing;
